function printPDF() {
    const { jsPDF } = window.jspdf;
    const toggleState = document.getElementById("togglePagination").innerText;
    const doc = new jsPDF({
        orientation: 'p', 
        unit: 'mm',
        format: 'a4'
    });
    doc.setFont('helvetica', 'normal'); 

    // image load Base64
    const base64String = "data:image/png;base64,"
    doc.addImage(base64String, 'PNG', 29, 10, 150, 18);
    doc.autoTable({
        html: '#data-table',
        theme: 'plain',  
        startY: 34,
        styles: {
            fontSize: 10,
            cellPadding: 5,
            fillColor: [255, 255, 255], 
            textColor: [50, 50, 50], 
            lineWidth: 0.2,
            lineColor: [220, 220, 220] 
        },
        headStyles: {
            fillColor: [30, 30, 30], 
            textColor: [255, 255, 255],
            fontStyle: 'bold'
        },
        alternateRowStyles: {
            fillColor: [245, 245, 245] 
        },
        columnStyles: {
            0: { cellWidth: 'auto' }, 
            1: { cellWidth: 'auto' },
            2: { cellWidth: 'auto' }
        },
    });

    let fileName; // Declare the variable
    if (toggleState === "Show All") {
        fileName = "Sci_com_SW.pdf";
    } else {
        fileName = "Sci_com_SW(all).pdf";
    }
    // console.log(toggleState);
   
    try {
        doc.save(fileName);
    } catch (error) {
        console.error("Fail to load Base64:", error);
    }
}

